@jfkirkegaard @StuartKLau If you want to experience the "Tegel" feeling, jump on a flight to the former German "Hauptstadt" airport CGN..

Its a sister to the TXL airport, modernized and expanded-.
A great excuse to get out of the Berlin jungle and into "normales Deutschland" on the Rhine....

